import React from 'react'

const SidebarItem = () => {
  return (
    <div>
        <div className="flex flex-row items-center space-x-2 p-2 hover:bg-gray-100 cursor-pointer">
            <span className="material-symbols-outlined">home</span>
            <span>Home</span>
        </div>
    </div>
  )
}

export default SidebarItem
